import React from 'react';

class Comment extends React.Component{
    render(){
        return(
            <div>
                <div>
                    <h2>
                        {this.props.comments.name}
                        <button>DELETE</button>
                    </h2>
                </div>
                <div>
                    <p>
                        {this.props.comments.message}
                        <button>EDIT</button>
                    </p>
                </div>
            </div>
        );
    };
}

export default Comment;
